import React from "react";
import { PDFViewer, Page, Text, View, Document } from '@react-pdf/renderer';
// import { RPConfig, RPProvider, RPDefaultLayout, RPPages } from "@pdf-viewer/react";

function LectionPage() {
  return (
    <PDFViewer>
      <Document>
        <Page size="A4">
          <View>
            <Text>Section #1</Text>
          </View>
          <View>
            <Text>Section #2</Text>
          </View>
        </Page>
      </Document>
    </PDFViewer>
  );
}

export default LectionPage;
